import React, {Component} from 'react';
import Product from './Product/Product';

class Shop extends Component {
    constructor(){
        super();
        this.state = {
            giftCard: {
                id: 1,
                title: 'gift card',
                price: 50.00,
                name: '',
                address: '',
                email: ''
            }
        }
    }

    render(){
        return(
            <div id='shop'>
                <header className="App-header">
                    {/* <img src={logo} className="Shop-logo" alt="logo" /> */}
                    <h1 className="App-header-text">Roxy Shop</h1>
                </header>
                <select name="price" id="price"></select>
                <Product card={this.state.giftCard}/>
            </div>

        )
    }
}

export default Shop;
